package leetcode.editor.cn;//给你一个字符串 s 、一个字符串 t 。返回 s 中涵盖 t 所有字符的最小子串。如果 s 中不存在涵盖 t 所有字符的子串，则返回空字符串 "" 。
//
// 注意：如果 s 中存在这样的子串，我们保证它是唯一的答案。 
//
// 
//
// 示例 1： 
//
// 
//输入：s = "ADOBECODEBANC", t = "ABC"
//输出："BANC"
// 
//
// 示例 2： 
//
// 
//输入：s = "a", t = "a"
//输出："a"
// 
//
// 
//
// 提示： 
//
// 
// 1 <= s.length, t.length <= 105 
// s 和 t 由英文字母组成 
// 
//
// 
//进阶：你能设计一个在 o(n) 时间内解决此问题的算法吗？ Related Topics 哈希表 字符串 滑动窗口 
// 👍 1219 👎 0


import java.util.HashMap;
import java.util.Map;

//leetcode submit region begin(Prohibit modification and deletion)
class Solution_76 {

    /*
     * 暴力法最优可优化到N2,在N长度较长时时间依然较长
     * 因为是找最短长度，暴力法多了无效的计算和比较
     * */
    public String minWindow(String s, String t) {
        int sLen = s.length();
        int tLen = t.length();
        if (sLen < tLen) {
            return "";
        }
        char[] sArr = s.toCharArray();
        char[] tArr = t.toCharArray();
        //        Map<Character, Integer> tFreqMap = new HashMap<>();
        //        Map<Character, Integer> sFreqMap = new HashMap<>();
        int[] tFreq = new int[128];
        int[] sFreq = new int[128];
        for (char c : tArr) {
            tFreq[c]++;
        }
        // 汉明距离，与tLen长度相等则包含t中所有字符
        int distance = 0;
        // 滑动窗口左右指针，左闭右开
        int left = 0;
        // 起始0，先加一
        int right = 0;
        // 保存最终最短区间起点
        int begin = 0;
        // 最短长度
        int minLen = sLen + 1;
        // 先右移到指定的distance再开始左移，外层while循环即控制distance相关的右移
        while (right < sLen) {
            //            System.out.println("right" + right + " " + left);
            char c = sArr[right];
            if (tFreq[c] == 0) {
                right++;
                continue;
            }
            if (sFreq[c] < tFreq[c]){
                distance++;
            }
            // 左侧移动完该右侧移动了，或者未达到右侧最长长度，还要继续移动
            sFreq[c]++;
            right++;
            // 小于tLen的长度无须遍历,left < right不要少
            while (distance == tLen) {
                //                System.out.print(left + "-" + right + "-" + +distance + " ");
                if (right - left < minLen) {
                    // right已经加一，此处是下一个索引
                    minLen = right - left;
                    begin = left;
                }
                c = sArr[left];
                if (tFreq[c] == 0) {
                    left++;
                    continue;
                }
                // 在频次变少的之前为大于，等于时为最短长度
                if (sFreq[c] == tFreq[c]) {
                    distance--;
                }
                // 左侧移动完该右侧移动了，或者未达到左侧最短长度，还要继续移动
                sFreq[c]--;
                left++;
            }
        } if (minLen == sLen + 1) {
            return "";
        }
        return s.substring(begin, begin + minLen);
    }

    public static void main(String[] args) {
        Map<Character, Integer> map = new HashMap<>();
        map.put('a', 1);
        map.put('a', 2);
        System.out.println(map);
        System.out.println(map.getOrDefault('a', 0));
        map.put('a', map.getOrDefault('a', 0) + 1);
        System.out.println(map);
        System.out.println(new Solution_76().minWindow(
                "",
                ""));
    }

}
